Information
------------------------------

Grand Designs: Series 15
Presenter Kevin McCloud follows some of Britain's most ambitious self-building projects, as intrepid individuals attempt to design and construct the home of their dreams
Kevin presents the first of four special programmes inspired by 15 years of Grand Designs with new footage and interviews with experts in the latest architectural thinking


1)  Living in the City 
In this first episode Kevin begins with a look at the challenges of self-building in the city, where space is at a premium and architects have to be at their most ingenious. Kevin uses footage from the best urban builds from the show over the years, meets pioneers at the forefront of the latest architectural thinking and looks at clever innovations that continue to transform people's lives to reveal which designs work best and why.

2)  Living in the Wild 
In the second of four special programmes, Kevin McCloud looks at the challenges of self-building in the UK's most remote places, where beautiful landscapes often meet savage weather. Drawing on footage from 15 years of the programme, as well as new visits to extraordinary and incredible homes, Kevin reveals which designs work best, and why. Along the way, he interviews pioneers at the forefront of architecture in the wilderness and sees the astonishing lengths people go to live on the edges of society.

3)  Living in Suburbia 
Kevin reveals how self-builders in the suburbs are transforming this most maligned of residential environments. He draws on some of the best examples from the 15-year history of Grand Designs, talks to experts in the latest architectural thinking and reveals the designs that have reinvented the suburbs as a place where home-owners really can have it all.

4)  Living in the Country 
Kevin McCloud looks at the challenges of self-building in the countryside, where design must embrace and enhance tradition, yet often overcome stringent planning constraints. Drawing on footage from the show's 15-year history, as well as new visits to extraordinary homes, he finds out how pioneers at the forefront of architecture are transforming agricultural and historic buildings, and bringing cutting-edge contemporary design to rural parts.

